import React from 'react';

const VideoListItem = props => {
  console.log(props.videos);
  const videoData = {

    title: props.snippet.title,
    img: props.snippet.thumnail.default.url,
    channel: props.snippet.chanelTitle
  };

  const dsd = props.videos.map(video => (
    <div >
      <li onClick={() => video.onVideoSelect(props)}>
        <img src={videoData.img} alt={videoData.title} />
        <div>
          <span>{videoData.title}</span>
          <small>{videoData.channel}</small>
        </div>
      </li>
    </div>
  ))
  return (
    { dsd }
  )
}
export default VideoListItem;
